The `scanPorts` function performs the port scanning by iterating over the ports array, creating a TCP connection to each port using `net.Dial`. If the connection succeeds and there is no error, the port is considered open and added to the openPorts array.

Finally, the open ports are sorted and printed in the `main` function.

